import React from 'react'

export const art = () => {
    return (
        <div id="app"></div>
    )
}

export default art
function App() {
    const [color, setColor] = React.useState({
        hue: 200,
        saturation: 100,
        luminosity: 50,
        alpha: 1
    });

    const onInput = (hue) => {
        setColor({ ...color, hue });
    };

    return (
        <div>
            <ReactColorPicker {...color} onInput={onInput} />
            <h1>Radial Color Picker - React</h1>
            <pre>{JSON.stringify(color, null, 4)}</pre>
        </div>
    );
}

ReactDOM.render(<App />, document.getElementById("app"));
